import { Card, Hand } from "../models/card.model";

export class CardService{
    
    hand!: Card[]

    constructor(){}

    addCard(valueCard: number, colorCard: string, imgCard: string){
        this.hand.push({
            value: valueCard,
            color: colorCard,
            img: imgCard
        })
        console.log(this.hand)
    }

}
